Where to Fix in Your Local Code

 Look for these files in your frontend source code:

 1. Token Service File (likely named something like):
   - src/services/tokenService.js
   - src/api/tokens.js
   - src/services/auth.js
 2. Token Component (where the API call is made):
   - src/pages/Tokens.jsx
   - src/components/TokenList.jsx
 3. Search for the problem in your code:
 # In your frontend directory
 grep -r "http://api" src/
 grep -r "/api/auth/tokens" src/

 The Fix

 Find where the token API URL is constructed and change:

 FROM:
 const tokenUrl = `http://api.92.5.226.7.nip.io/api/auth/tokens/`;
 // OR
 const tokenUrl = apiBaseUrl.replace('https://', 'http://') + '/api/auth/tokens/';
 // OR
 const tokenUrl = 'http://' + API_HOST + '/api/auth/tokens/';

 TO:
 const tokenUrl = `${import.meta.env.VITE_API_URL}/api/auth/tokens/`;
 // OR
 const tokenUrl = `https://api.92.5.226.7.nip.io/api/auth/tokens/`;
 // OR ensure HTTPS
 const tokenUrl = apiBaseUrl.replace(/^http:/, 'https:') + '/api/auth/tokens/';

 After Fixing

 1. Rebuild your frontend locally
 2. Deploy the updated build to your server
 3. Clear browser cache
 4. Test the token list page

 The key is finding where specifically the token endpoint URL is being constructed differently from your other working endpoints.
